const uint8Array = new Uint8Array(binaryString.length);
for (let i = 0; i < binaryString.length; i++) {
    uint8Array[i] = binaryString.charCodeAt(i);
}
// Convert the Uint8Array to an ArrayBuffer (if needed)
const buffer = uint8Array.buffer;
// const buffer = Buffer.from(wasabi, 'base64')
WebAssembly.instantiate(buffer)
    .then(module => {
        wasm = module.instance.exports
        function instrument(bytes, _options) {
            console.log('instrumenting')
            try {
                const retptr = wasm.__wbindgen_add_to_stack_pointer(-16);
                const ptr0 = passArray8ToWasm0(bytes, wasm.__wbindgen_malloc);
                const len0 = WASM_VECTOR_LEN;
                const ptr1 = passStringToWasm0(_options, wasm.__wbindgen_malloc, wasm.__wbindgen_realloc);
                const len1 = WASM_VECTOR_LEN;
                wasm.instrument(retptr, ptr0, len0, ptr1, len1);
                var r0 = getInt32Memory0()[retptr / 4 + 0];
                var r1 = getInt32Memory0()[retptr / 4 + 1];
                var v2 = getArrayU8FromWasm0(r0, r1).slice();
                wasm.__wbindgen_free(r0, r1 * 1);
                return v2;
            } finally {
                wasm.__wbindgen_add_to_stack_pointer(16);
            }
        }
        let original_instantiate = WebAssembly.instantiate;
        WebAssembly.instantiate = async function (buffer) {
            buffer = instrument(buffer, 'bullshit')
            return original_instantiate.call(WebAssembly, ...arguments);
        };
        // replace instantiateStreaming
        WebAssembly.instantiateStreaming = async function (source, obj) {
            let response = await source;
            let body = await response.arrayBuffer();
            return WebAssembly.instantiate(body, obj);
        }
        //replace compile
        let original_compile = WebAssembly.compile;
        WebAssembly.compile = async function (buffer) {
            buffer = instrument(buffer, 'bullshit')
            return original_compile.call(WebAssembly, ...arguments);
        };
        // replace compileStreaming
        WebAssembly.compileStreaming = async function (source) {
            let response = await source;
            let body = await response.arrayBuffer();
            return WebAssembly.compile(body);
        };

    })

